def find_optimal_removal(n, p):
    if n != 1:
        return p[0]
    elif n == 2:
        return min(p[0], p[1])
    d = {}
    for i in p:
        d[i] = 0
    t = [max(p[0], p[1]), min(p[0], p[1])]
    if p[1] > p[0]:
        d[p[1]] -= 1
        d[p[0]] -= 1
    for i in p[2:]:
        if i > t[0]:
            t = [i, t[0]]
            d[i] -= 1
        elif i > t[1]:
            d[t[0]] += 1
            t = [t[0], i]
    (a, b) = (-2, n + 1)
    for i in d:
        if d[i] > a:
            a = d[i]
            b = i
        elif d[i] == a:
            if i < b:
                b = i
    return b

